import { props } from 'bluebird'
import React from 'react'
import Cats from './Cats'


const CardContainer = () => {

    const displayPics = () => {
        return props.photos.map(photo => {
            return <Cats url = {photo.url} />
        })
    }

    return (

        <>
        <p>The photos will show here</p>
        </>
    )
}

export default CardContainer
